generated:
  The number of different routes from point $A$ to point $B$ is equal to the number of ways to arrange the segments in a 10 by 10 grid such that each row and each column contain at least one segment.

[asy]
unitsize(0.09inch);
fill((0,0)--(10,0)--(10,10)--(0,10)--cycle);
draw((5,0)--(5,10));
draw((0,5)--(10,5));
dot((0,10));
dot((10,0));
label("$A$",(0,10),NW);
label("$B$",(10,0),SE);
[/asy]

The total number of segments in the grid is $10 \cdot 10 = 100$.

The number of ways to arrange the segments in each row and each column is given by the multinomial coefficient $\binom{n}{k_1, k_2, \dots, k_r} = \frac{n!}{k_1!k_2!\dotsm k_r!}$.

Substituting $n = 100$ and $k_1 = k_2 = \dots = k_r = 10$, we get
\[\binom{100}{10,10,\dots,10} = \frac{100!}{10!10!\dotsm 10!} = 1.\]
So there is only one route from point $A$ to point $B$. The answer is: $\boxed{1}$

